export const baseLayer = {
    id: 'county',
    type: 'fill',
    paint:{
        'fill-color': '#aed6f1',
        "fill-opacity": 0.5, 
        "fill-outline-color": "#2e86c1"
    }
};

export const selected = {
    id: 'selected',
    type: 'line',
    paint:{
        "line-opacity": 0.5, 
        "line-color": "#aed6f1"
    }
};
